import React from "react";

import "./Project.css";

const project = props => {
  let paper, github;
  let responsive_big, responsive_small;
  if (props.paper != null) {
    paper = <a href={props.paper}>[Paper]</a>;
  }
  if (props.github != null) {
    github = <a href={props.github}>[Github]</a>;
  }

  responsive_big = (
    <ul className="project large">
      <li className="project__image">
        <img src={props.image} alt={props.title} />
      </li>
      <li className="project__info">
        <ul className="project__content">
          <li className="project__title">{props.title}</li>
          <li className="project__explanation">
            <p>{props.explanation}</p>
          </li>
          <li className="project__refereces">
            {paper}
            {github}
          </li>
        </ul>
      </li>
    </ul>
  );

  responsive_small = (
    <ul className="project small">
      <li className="project_image">
        <img src={props.image} alt={props.title} />
      </li>
      <li className="project__title">{props.title}</li>
      <li className="project__explanation">
        <p>{props.explanation}</p>
      </li>
      <li className="project__refereces">
        {paper}
        {github}
      </li>
    </ul>
  );

  return { responsive_big };
};

export default project;
